import { useState } from "react";
import "./App.css";
import VideoCapture from "./FaceReco/VideoCapture";
import Navbar from "./Components/Navbar/Navbar";

import Card from "./Components/Card/Card";

import PresentList from "./ListPresent/PresentList";

function App() {
  const [showCard, setShowCard] = useState(false);

  return (
    <div className="App">
      <Navbar onToggleCard={setShowCard} />
      <Card showCard={showCard} onToggleCard={setShowCard} />
      <div className="Hidder"></div>
      <div className="TheTwoFriends">
        <PresentList /> <VideoCapture />
      </div>
    </div>
  );
}

export default App;
